TurtleCoin is an open source project. This means that originally, the code we used to form the network came from another project that published their work with a license that allowed any user to use, share, and modify the underlying code. That means that anybody can use the original code to create their own network, and as they add features to that code, the license says their users get the same privilege. This culture of sharing and freely distributing software helps us spot bugs and improve quickly while attracting collaborators from the outside community.

&nbsp;

TurtleCoin was created December 9th, 2017 using Bytecoin's original software as the base with a tool called ForkNote. Since Bytecoin was produced under an open source license, so is TurtleCoin. TurtleCoin is a great base for other projects, and many projects have been made from TurtleCoin's software. These other networks are important to us as an open source project because we all work together to fix bugs and add new features.

&nbsp;

Another network that based their code on the original Bytecoin code is Monero. When you base your software on another project's base, that is called a fork, because you've now created a new path in the code history.

In the beginning of the class, we learned that the Daemon is your connection to the network. How do you access your funds though?

&nbsp;

For interacting with funds on the TRTL network, we have program called Zedwallet that works with the Daemon to look at your keys and see which blocks have money that belongs to you. Originally, we had a program that kind of worked, called Simplewallet, but Zpalmtree rewrote it from scratch and now we have Zedwallet (and probably Zedwallet++ by the time you see this). Zedwallet has lots of easy functions that you can use to make your life easier, like "optimize" which will take all of your little turtle nickels and dimes and turn them into solid coins so you can send more in a single transaction.

&nbsp;

The role of the wallet is to allow you to send, receive, and backup your funds on the network. Zedwallet uses the Daemon to look up blocks, and then tries to unlock each one with its keys. When you create a wallet, you are given several keys that are very important so that you can restore your funds anywhere. Upon creating a wallet, you're given a spend key, view key, and mnemonic seed. This sounds complicated at first, but stick with me. The mnemonic seed is something you might be used to seeing, and it's just a series of words that are easily remembered that allows you to restore your wallet anywhere and have all the funds be there. The mnemonic seed is just an encoded way for a human to remember their view key and spend key. You must write this down, or you'll be truly living on the edge. Nothing can save you if you lose these codes and then delete your wallet.

&nbsp;

Using Zedwallet you can type commands like "address" or "balance" or even use the corresponding menu number for them. The most important command, however, is to remember to "backup" your keys so that you never lose access to your funds. That's menu item #4 if you want to use the shortcut.

Fun Fact: Turtle-Service is the #1 most confused tool in the core suite, and yet we still include it in every build. Why is that?

In the early days of the network, the core wallet was called simplewallet, and what is today called Turtle-Service was called Walletd. As you can imagine, there was quite the confusion when users would run Walletd expecting a simple command line wallet, and just got a blank screen. The purpose of Turtle-Service is to give access to <em>programs</em> who need to manage a wallet, as opposed to a <em>human</em>, who would use something like Zedwallet. Zedwallet has a frontend, which means it has menus and things that allow you to navigate through different functions like creating a wallet or sending some coins to a friend. Turtle-Service, as you might have noticed, doesn't really do anything if you just run the program. You can try it now, and you may just get a black window that pops up and disappears, or it might just do nothing at all.

&nbsp;

Turtle-Service doesn't actually have any buttons or anything you can touch, really. It speaks through what's called a JSON request. You may or may not know what that means, but to put it simply, it's expecting a program like a web wallet to send it a request that is written in JSON that says something like "Create a new wallet in the container" or "send X coins to so and so". JSON stands for Javascript Object Notation and this is the last time you'll ever need to know that. It's not important that you know what goes in one of these requests unless you want to go on to being a developer, but here's what it would look like if you wanted to generate one in your command line to check the balance of a wallet.

&nbsp;
<pre class="EnlighterJSRAW" data-enlighter-language="generic">curl -d '{"jsonrpc":"2.0","id":1,"password":"passw0rd","method":"getBalance","params":{"address":"TRTLxxxx..."}}' http://localhost:8070/json_rpc</pre>
&nbsp;

Turtle-Service would emit a response, and it would look something like this:
<pre class="EnlighterJSRAW" data-enlighter-language="json">{
  "id": 1,
  "jsonrpc": "2.0",
  "result": {
    "availableBalance": 10000,
    "lockedAmount": 0
  }
}</pre>
This means that Turtle-Service is great for use with web wallets, graphical wallets, online stores and mining pools. Most commonly, a lot of graphical wallets use Turtle-Service as their core. The GUI is just button shortcuts that mask commands that happen in the background. If you run most of our graphical wallets and then look at the running processes on your computer, you'll see "Turtle-Service" in the list because at almost every GUI's core is Turtle-Service.

&nbsp;

Recently, a new contender has entered the ring, and that is Wallet-API. Wallet-API functions much the same way that Walletd and Turtle Service did, but much better, as it is a from scratch rewrite by the same person who brought you ZedWallet.

The miner that is included in the core software is the most basic way to contribute to the decentralization of the network. The role of the miner is to process transactions and form them into blocks that are part of the blockchain. When many miners are competing to produce a block first, the mining difficulty rises to keep the rate of blocks at a steady 30 second interval.

&nbsp;

<strong>What is difficulty?</strong>

When a miner is trying to mine a block, what is happening is their computer is racing to guess numbers that can possibly unlock the current block and collect a reward. When you are using the included TurtleCoin miner, you're using just your CPU to guess the numbers. Other parts of your computer can do this type of work, and they can do it faster! If you have additional hardware like a GPU which is common in most gaming computers, you can mine faster using other third party miners. Imagine if you were present for a lottery, and every 30 seconds a ticket is selected and a winner is chosen, who then gets to pick the next ticket. When there are a lot of people trying to participate in the lottery, there needs to be added complexity, so instead of a 5 digit number on the lottery ticket, we now have 10 digits, or more as people join the crowd guessing lottery numbers. This is what we call "difficulty" and it's just a representation of how long the number is that unlocks the block.

&nbsp;

<strong>What is a mining pool?</strong>

When many people are mining, and the network is set to adjust difficulty to keep blocks at an even 30 seconds per block, you start to wonder how long you'll have to mine to earn some coins. What if you and the 3 people next to you come to an agreement that you'll all guess lottery numbers together, and if anybody picks a winning number they'll share it with the friends? This is similar to what we call "mining pools" where people pool their resources and share block rewards in direct proportion to their mining power. So if it took 100 guesses to break a block, and you made 10 guess attempts and your friend made 40, and another guy 50, then the reward will be distributed proportionally to the effort you expended. It's like working on commission.

&nbsp;

Mining on a pool is easier than mining solo, however, there are drawbacks. When you are mining on a pool you're contributing hashpower to a single daemon that's competing to create the next block, so that amount of power makes the voice of that one daemon very loud. This has a positive effect that you're able to receive a more steady trickle of coins, but it has the negative effect of causing network centralization. If that one large pool breaks, goes rogue, or does something nasty with their mining power, everyone suffers because so much of the network relies on them to process transactions.

&nbsp;

When you are mining without a pool, and you're only using the miner that comes with the TurtleCoin core software, you're considered to be "mining solo" or "solo-mining". It means you're the only miner that is submitting hash attempts through your daemon.
